import React,{Component} from "react";
import "./contatos.css";


class Contatos extends Component {

    render(){
        return(
                <div className="quem-somos-flex">
                    <div className="quem-somos-textos">
                        <div className="quem-somos-titulo">
                            <li> R. Cons Antônio Prado, 1810 ·</li>
                            <li>Telefone:  (19) 3381-3973</li>
                            <li>Website: <a href="#" title="">http://helpacabamentos.com.br</a></li>
                            <li>Email: helpacabamentos@gmail.com </li>
                        </div>
                    </div>
                </div>
        )
    }


}
export default Contatos;
